import React from "react";
import {
  Card,
  CardImg,
  CardImgOverlay,
  CardTitle
} from "reactstrap";
import { Link } from "react-router-dom";

class Directory extends Component {
  constructor(props) {
      super(props);
      this.state = {};
  }

  render() {
    const directory = this.state.campsites.map(game => {
        return (
            <div className="col">
                <img src={game.image} alt={game.name} />
                <h2>{game.name}</h2>
                <p>{game.description}</p>
            </div>
        );
    });

    return (
        <div className="container">
            <div className="row">
                {directory}
            </div>
        </div>
    );
}
}

export default Directory;
